import time
start_time = time.time()

def p_func(s):
    n = len(s)
    pi = [0] * n
    for i in range(1, n):
        j = pi[i-1]
        while j > 0 and s[i] != s[j]:
            j = pi[j-1]
        if s[i] == s[j]:
            j += 1
            pi[i] = j
    return pi

string = ''

pi = p_func(string)
B = [0] * len(string)

for i in range(len(pi)):
    if string.count(string[0:pi[i]], 0, i ) + string.count(string[0:pi[i]], 1, i ) >= 3:
        B[i] = pi[i]


print(B)


print()
print("time elapsed: {:.2f}s".format(time.time() - start_time))